import { errorImg } from "../assets/images/photos"
import NavBar from "../components/navbar/navabar";
import { useNavigate } from "react-router-dom";
export default function ErrorPage() {
    const navigate=useNavigate()
    return <div>
    <NavBar/>
        <figure className="banner1"
        >
        <figcaption 
       >
            <h2 className="banner-title1">404 Page not Found</h2></figcaption>
            {/* <img className="error-img "src={errorImg} alt="error-page"/> */}
            <button className="banner-btn1 cursor-pointer banner-title1"onClick={()=>navigate(-1)}>Go Back</button>
        </figure>
    </div>
}
